def scoreOfParentheses(S):
    stack = [0]
    count = S.count('()')
    for i in S:
        if i == '(':
            stack.append(0)
        else:
            v = stack.pop()
            stack[-1] += max(2 * v, 1)
    return stack.pop() / count

